import React, { useEffect, useState } from 'react';
import axios from "axios";
import { removeCookie } from './utils/cookie';

const Logout = () => {
    axios
      .post('/logout')
      .then((response) => {
        const {
          data: { resultCode },
        } = response;
        const {
          data: { result },
        } = response;

      })
      .catch((error) => {
        console.error('login error:', error);
      });
}
export default Logout;
